export default defineComponent({
  components: {
    HasDataVillage,
    NoDataVillage
  },
  setup() {
    const activeColor = '#16ECFF';
    const activeOpacity = 0.5;
    const defaultColor = '#041E29';
    const defaultOpacity = 1;
    let activeTarget: any;
    function setActive(target: any, isActive: Boolean = true) {
      if(isActive) {
        target.setAttribute('fill', activeColor);
        target.setAttribute('fill-opacity', activeOpacity);
        target.setAttribute('stroke', activeColor)
        target.setAttribute('stroke-width', 10)
        target.setAttribute('stroke-opacity', 1)
        target.setAttribute('stroke-dasharray', '')
      } else {
        target.setAttribute('fill', defaultColor);
        target.setAttribute('fill-opacity', defaultOpacity);
        target.setAttribute('stroke', activeColor)
        target.setAttribute('stroke-width', 2)
        target.setAttribute('stroke-opacity', 0.3)
        target.setAttribute('stroke-dasharray', '10 10')
      }
    };
    function handleMapClick(e: any) {
